drop database if exists test;
create database test;
use test;

drop database if exists test2;
create database test2;

drop table if exists checksum_test, checksum, fl_test, argtest;

create table checksum_test(
   a int not null primary key auto_increment
) auto_increment = 5;

create table test2.checksum_test(
   a int not null primary key auto_increment
);

insert into checksum_test(a) values (1);

CREATE TABLE checksum (
 db         char(64)     NOT NULL,
 tbl        char(64)     NOT NULL,
 chunk      int          NOT NULL,
 boundaries char(64)     NOT NULL,
 this_crc   char(40)     NOT NULL,
 this_cnt   int          NOT NULL,
 master_crc char(40)         NULL,
 master_cnt int              NULL,
 ts         timestamp    NOT NULL,
 PRIMARY KEY (db, tbl, chunk)
);

create table argtest (
 db         char(64)     NOT NULL,
 tbl        char(64)     NOT NULL,
 since      char(64) NOT NULL,
 primary key(db, tbl)
);

-- should cause an error because of foobar, but not because of ts
create table argtest2 (
 db         char(64)     NOT NULL,
 tbl        char(64)     NOT NULL,
 ts         timestamp    NOT NULL,
 foobar     char(50),
 primary key(db, tbl)
);

create table blackhole(a int)engine=blackhole;

insert into argtest select 'test', 'checksum_test', '1';
insert into argtest select 'test', 'argtest', 'current_date-interval 30 day';
insert into argtest select 'test', 'chunk', '1';

insert into argtest2 select 'test', 'chunk', '1', 2;

create table fl_test(a float not null primary key, b double);
-- CREATE FUNCTION fnv_64 RETURNS INTEGER SONAME 'fnv_udf.so';
DROP TABLE IF EXISTS `chunk`;
CREATE TABLE `chunk` (
  `film_id` smallint(5) unsigned NOT NULL auto_increment,
  `title` varchar(255) NOT NULL,
  `description` text,
  `release_year` year(4) default NULL,
  `language_id` tinyint(3) unsigned NOT NULL,
  `original_language_id` tinyint(3) unsigned default NULL,
  `rental_duration` tinyint(3) unsigned NOT NULL default '3',
  `rental_rate` decimal(4,2) NOT NULL default '4.99',
  `length` smallint(5) unsigned default NULL,
  `replacement_cost` decimal(5,2) NOT NULL default '19.99',
  `rating` enum('G','PG','PG-13','R','NC-17') default 'G',
  `special_features` set('Trailers','Commentaries','Deleted Scenes','Behind the Scenes') default NULL,
  `last_update` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,
  PRIMARY KEY  (`film_id`),
  KEY `idx_title` (`title`),
  KEY `idx_fk_language_id` (`language_id`),
  KEY `idx_fk_original_language_id` (`original_language_id`)
);

